void key_received(void) {

    // Get the received letter
    int RVALID = ((*((int *) 0xFF200100))&0x8000);
    int input = (*((int *)0xFF200100)&0xFF);
    if(RVALID != 0) {
        if(GET_LETTER_NOW == TRUE) {
            letter_received = input;
            GET_LETTER_NOW = FALSE;
        }
        else if(input == 0xF0) {
            GET_LETTER_NOW = TRUE;
        }
    }

}

// Define the IRQ exception handler
void __attribute__((interrupt)) __cs3_isr_irq(void) {
// Read the ICCIAR from the CPU Interface in the GIC
    int interrupt_ID = *((int *)0xFFFEC10C);
    if (interrupt_ID == 79) // check if interrupt is from the PS2 controller
        key_received();
    else
    while (1); // if unexpected, then stay here
    // Write to the End of Interrupt Register (ICCEOIR)
    *((int *)0xFFFEC110) = interrupt_ID;
}

void clear_screen() {
    // Loop through the entire screen
    for(int x = 0; x < RESOLUTION_X; x++) {
        for(int y = 0; y < RESOLUTION_Y; y++) {
            // Write to the pixel address
            plot_pixel(x, y, BLACK);
        }
    }
}

void plot_pixel(int x, int y, short int line_color)
{
    // Write color to the pixel address (buffer start + xy offset)
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void wait_for_vsync() {

    // pixel control pointer (points to pixel buffer)
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;

    //register int = store in CPU register, not memory (faster access)
    register int status;

    *pixel_ctrl_ptr = 1; //start the sync process - set status bit to 1, poll until it becomes 0 when buffer swap is performed

    status = *(pixel_ctrl_ptr + 3); 
    // Read status register of DMA 
    // Adding 3 here adds 12, since data type of ptr is word (int*), which has 4 bytes
    while((status & 0x01) != 0) {
        status = *(pixel_ctrl_ptr + 3);
    }

}

/*
* Configure Set Enable Registers (ICDISERn) and Interrupt Processor Target
* Registers (ICDIPTRn). The default (reset) values are used for other registers
* in the GIC.
*/
void config_interrupt(int N, int CPU_target) {
    int reg_offset, index, value, address;
    /* Configure the Interrupt Set-Enable Registers (ICDISERn).
    * reg_offset = (integer_div(N / 32) * 4
    * value = 1 << (N mod 32) */
    reg_offset = (N >> 3) & 0xFFFFFFFC;
    index = N & 0x1F;
    value = 0x1 << index;
    address = 0xFFFED100 + reg_offset;
    /* Now that we know the register address and value, set the appropriate bit */
    *(int *)address |= value;
    /* Configure the Interrupt Processor Targets Register (ICDIPTRn)
    * reg_offset = integer_div(N / 4) * 4
    * index = N mod 4 */
    reg_offset = (N & 0xFFFFFFFC);
    index = N & 0x3;
    address = 0xFFFED800 + reg_offset + index;
    /* Now that we know the register address and value, write to (only) the
    * appropriate byte */
    *(char *)address = (char)CPU_target;
}

/*
* Configure the Generic Interrupt Controller (GIC)
*/
void config_GIC(void) {
    config_interrupt (79, 1); // configure the PS/2 Controller Keyboard (7)
    // Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all
    // priorities
    *((int *) 0xFFFEC104) = 0xFFFF;
    // Set CPU Interface Control Register (ICCICR). Enable signaling of
    // interrupts
    *((int *) 0xFFFEC100) = 1;
    // Configure the Distributor Control Register (ICDDCR) to send pending
    // interrupts to CPUs
    *((int *) 0xFFFED000) = 1;
}

void config_PS2(void) {
    // set the interrupt enable to 1
    *((int *)0xFF200104) = 0x1;
}

void disable_A9_interrupts(void) {
    int status = 0b11010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}

void set_A9_IRQ_stack(void) {
    int stack, mode;
    stack = 0xFFFFFFFF - 7; // top of A9 onchip memory, aligned to 8 bytes
    /* change processor to IRQ mode with interrupts disabled */
    mode = 0b11010010;
    asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
    /* set banked stack pointer */
    asm("mov sp, %[ps]" : : [ps] "r"(stack));
    /* go back to SVC mode before executing subroutine return! */
    mode = 0b11010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
}

void enable_A9_interrupts(void) {
    int status = 0b01010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}

// Define the remaining exception handlers
void __attribute__((interrupt)) __cs3_reset(void) {
    while (1);
}
void __attribute__((interrupt)) __cs3_isr_undef(void) {
    while (1);
}
void __attribute__((interrupt)) __cs3_isr_swi(void) {
    while (1);
}
void __attribute__((interrupt)) __cs3_isr_pabort(void) {
    while (1);
}
void __attribute__((interrupt)) __cs3_isr_dabort(void) {
    while (1);
}
void __attribute__((interrupt)) __cs3_isr_fiq(void) {
    while (1);
}


void swap(int* a, int* b){
    int temp = *a;
    *a = *b;
    *b = temp;
}

void draw_line(int x0, int y0, int x1, int y1, short int color){
    bool steep = abs(y1-y0) > abs(x1-x0);
    if(steep){
        swap(&x0 , &y0);
        swap(&x1,&y1);
    }
    if(x0>x1){
        swap(&x0,&x1);
        swap(&y0,&y1);
    }

    int delx = x1 - x0;
    int dely = abs(y1-y0);
    int error = -delx/2;
    int y = y0;
    int ystep;

    if(y0<y1){
       ystep = 1; 
    }
    else{
        ystep = -1;
    }

    for(int x = x0; x <= x1; x++){
        if(steep){
            plot_pixel(y,x,color);
        }
        else{
            plot_pixel(x,y,color);
        }
        error = error + dely;
        if(error >= 0){
            y += ystep;
            error -= delx;
        }
    }
}

void draw_img(int x0, int y0, const int byteArr[], int height, int width) {
    int color_index = 0;
    for (int y = 0; y < height; y++) {
        for (int x = 0; x < height; x++) {
            int x_coord = x0 + x;
            int y_coord = y0 + y;

            if (byteArr[color_index] != 0b1111100000011111 && x_coord >= 0 && y_coord >= 0 && x_coord <= 319 && y_coord <= 239) {
                plot_pixel(x_coord, y_coord, byteArr[color_index]);
                color_index += 1;
            }
        }
    }
}

void draw_wordle_box(int xpos, int ypos) {
    draw_line(xpos, ypos, xpos + BOX_LEN, ypos, WHITE);
    draw_line(xpos, ypos + BOX_LEN, xpos + BOX_LEN, ypos + BOX_LEN, WHITE);
    draw_line(xpos, ypos, xpos, ypos + BOX_LEN, WHITE);
    draw_line(xpos + BOX_LEN, ypos, xpos + BOX_LEN, ypos + BOX_LEN, WHITE);
}

void draw_grid() {
    for (int y = 17; y <= 212; y += BOX_LEN + 5) {
        for (int i = 75; i <= 225; i += BOX_LEN + 5) {
            draw_wordle_box(i, y);
        }
    }
}

void draw_box(short int color, int xpos, int ypos) {
    // Draw a mXm box, where m is BOX_LEN value
    for(int x = 0; x < BOX_LEN; x++) {
        for(int y = 0; y < BOX_LEN; y++) {
            plot_pixel(xpos + x, ypos + y, color);
        }
    }
}